import React, { useEffect, useState } from 'react';
import axios from 'axios';
import base_url from '../../api/bootapi';

const List=()=>{

const [workData, setWorkData]=useState();    


useEffect(()=>{
    axios.get(`${base_url}/user/workDetails/`).then((res)=>{
        console.log(res.data);
        setWorkData(res.data);
    });
},[]);

return <div>{
                !workData ? ("No Work Found") : (
                    <table className="table">
                        <thead>
                            <tr>
                                <th>Salary</th>
                                <th>Work</th>
                                <th>Location</th>
                                <th>Work Type</th>
                            </tr>
                        </thead>
                        <tbody>
                            {
                                workData.map((workDescription, index)=>(
                                    <tr key={index}>
                                        <td>{workDescription.workAmount}</td>
                                        <td>{workDescription.description}</td>
                                        <td>{workDescription.location}</td>
                                        <td>{workDescription.category}</td>
                                    </tr>
                                ))
                            }
                        </tbody>
                    </table>
                )
            }
        </div>
    
}
export default List;
